import React from 'react'
import './App.css'
import data from './list.json'

function List() {
    // console.log(data)
    return (
        // <h1>pawan</h1>
        <div className='container-fluid body-cont' style={{ paddingTop: 5, paddingBottom: 15 }}>
            <main>
                <div className='container'>
                    <button type='button' className='btn btn-outline-primary my-3'>
                        Catalogue {' '}
                    <i className='fa fa-chevron-right' style = {{marginTop : 4}}>
                        </i>
                    </button>
                    <div className='row'>

                        {data.map(movie => (
                            <div className='col-6 col-sm-4 col-md-3 col-xl-2 mb-3 mt-3 '>
                                <div className='box '>
                                    <a href={movie.thumbnail_link}>
                                        <img class=' mb-3' src={movie.thumbnail_link} alt={movie.movie_id}
                                            style={{ borderRadius: 10, width: 150, height: 220 }} />
                                    </a>
                                </div>
                            </div>


                        ))}
                    </div>
                </div>
            </main>
        </div>
    )
}

export default List;
